import React from 'react'
import {Route , Redirect} from 'react-router-dom'
// import * as isAuth from '../functions/isAuth' //return boolean

export function PrivateRoute({component: Component, isAuth , ...rest}) {
    // isAuth() === true ? console.log('auth') : console.log('not auth') console.log(isAuth)
    return (
        <Route
           {...rest}
           render = {() => isAuth ? 
            (    
                <Component/> 
            ):
            (
                <Redirect to="/login" />
            )
           }
        />
    )
}


export function PrivateRouteLogin({component: Component, isAuth , ...rest}) {
    // isAuth() === true ? console.log('auth') : console.log('not auth') console.log(isAuth)
    return (
        <Route
           {...rest}
           render = {() => isAuth ? 
            (    
                <Component/> 
            ):
            (
                <Redirect to="/login" />
            )
           }
        />
    )
}
